rawText:
 (props) => {
  const {
    markdownFileConfig,
    markedToken,
    subtextConfig,
    subwordConfig,
    testModeEnabled,
  } = props;

  const endsWithNewline = markedToken.raw.endsWith("\n");

  const paragraphText = markedToken.tokens.map((token) => (
    <MarkedToken
      item={token}
      subtextConfig={subtextConfig}
      subwordConfig={subwordConfig}
      markdownFileConfig={markdownFileConfig}
      testModeEnabled={testModeEnabled}
    />
  ));

  const paragraphSubtextHtmlString = getSubtext(markedToken.raw, subtextConfig);

  return (
    <div>
      {paragraphText}
      {paragraphSubtextHtmlString}
      {endsWithNewline ? <br /> : null}
    </div>
  );
}
